import React from 'react';
import './blogpost.css'; 

function BlogPost({ title, content }) {
  return (
    <div className="blog-post">
      <h2 className="blog-post-title">{title}</h2>
      <div className="blog-post-content">{content}</div>
    </div>
  );
}

export default BlogPost;
